/*Table structure for table `examen` */

DROP TABLE IF EXISTS `examen`;

CREATE TABLE `examen` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nom` varchar(45) NOT NULL,
  `prix` decimal(12,3) unsigned NOT NULL DEFAULT '0.000',
  `prix_perso` decimal(12,3) unsigned NOT NULL DEFAULT '0.000' COMMENT 'prix du personnel',
  `ref_labo` int(10) unsigned NOT NULL,
  `fichier` varchar(25) CHARACTER SET latin1 COLLATE latin1_spanish_ci DEFAULT NULL,
  `prix_nuit` decimal(12,3) DEFAULT NULL,
  `code` varchar(45) DEFAULT NULL,
  `actif` bit(1) DEFAULT b'1',
  `resultat` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ref_labo` (`ref_labo`),
  CONSTRAINT `examen_ibfk_1` FOREIGN KEY (`ref_labo`) REFERENCES `laboratoire` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=287 DEFAULT CHARSET=latin1;

