/*Table structure for table `facture` */

DROP TABLE IF EXISTS `facture`;

CREATE TABLE `facture` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ref_ecriture` int(10) unsigned NOT NULL,
  `num_piece` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ref_ecriture` (`ref_ecriture`),
  CONSTRAINT `facture_ibfk_1` FOREIGN KEY (`ref_ecriture`) REFERENCES `ecriture` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `facture` */

/*Table structure for table `fournisseur` */

DROP TABLE IF EXISTS `fournisseur`;

CREATE TABLE `fournisseur` (
  `CODE` varchar(45) NOT NULL,
  `actif` tinyint(1) NOT NULL DEFAULT '0',
  `date_debut` datetime NOT NULL,
  `dateMAJ` datetime NOT NULL,
  `Designation` varchar(200) NOT NULL,
  `userMAJ` varchar(45) NOT NULL,
  PRIMARY KEY (`CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `fournisseur` */

