/*Table structure for table `journal` */

DROP TABLE IF EXISTS `journal`;

CREATE TABLE `journal` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `evenement` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `user_maj` varchar(255) NOT NULL,
  `date_maj` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `journal` */

/*Table structure for table `laboratoire` */

DROP TABLE IF EXISTS `laboratoire`;

CREATE TABLE `laboratoire` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nom` varchar(45) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL,
  `responsable` varchar(255) DEFAULT NULL,
  `actif` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

/*Data for the table `laboratoire` */

insert  into `laboratoire`(`id`,`nom`,`responsable`,`actif`) values (1,'Hematologie-Hemostase','responsable',1),(2,'Biochimie Sanguine','responsable',1),(3,'Parasitologie','responsable',1),(4,'Bacteriologie','responsable',1),(5,'Immuno-Serologie','responsable',1),(6,'Biochimie Urinaire','responsable',1),(7,'Hormonologie','responsable',1),(8,'Autre','responsable',1),(9,'Marqueurs Tumoraux','responsable',1),(10,'ANAPATHOLOGIE','responsable',1);

/*Table structure for table `necessite` */

DROP TABLE IF EXISTS `necessite`;

CREATE TABLE `necessite` (
  `ref_examen` int(10) unsigned NOT NULL,
  `ref_reactif` int(10) unsigned NOT NULL,
  `qte` smallint(5) unsigned NOT NULL,
  PRIMARY KEY (`ref_examen`,`ref_reactif`),
  KEY `ref_reactif` (`ref_reactif`),
  CONSTRAINT `necessite_ibfk_1` FOREIGN KEY (`ref_examen`) REFERENCES `examen` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `necessite_ibfk_2` FOREIGN KEY (`ref_reactif`) REFERENCES `reactif` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `necessite` */

/*Table structure for table `parametres` */

DROP TABLE IF EXISTS `parametres`;

CREATE TABLE `parametres` (
  `id` varchar(20) NOT NULL,
  `valeur` varchar(30) NOT NULL DEFAULT '0.000',
  `description` varchar(50) NOT NULL,
  `valeurExt` text,
  `groupe` int(10) unsigned NOT NULL,
  `valeurImage` longblob,
  PRIMARY KEY (`id`)
