  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nom` varchar(45) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL,
  `age_p` varchar(10) CHARACTER SET latin1 NOT NULL DEFAULT '?',
  `sexe` char(1) CHARACTER SET latin1 NOT NULL,
  `interne` tinyint(1) NOT NULL DEFAULT '0',
  `type` int(10) unsigned DEFAULT NULL,
  `email` varchar(120) COLLATE latin1_general_ci DEFAULT NULL,
  `lang_key` varchar(5) COLLATE latin1_general_ci NOT NULL DEFAULT 'fr',
  `contact` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `date_naiss` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25634 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

