ont-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;;\r\ncolor:windowtext;\">METHODE UTILISEE: IMMUNOPEROXIDASE\r\nINDIRECT (IPAzyme)</span><span></span></h6>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<div>\r\n\r\n<table style=\"font-size:10.0pt;border-collapse:collapse;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n <tbody><tr>\r\n  <td style=\"width:105.95pt;border:solid windowtext 1.0pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"141\">\r\n  <p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><b><span style=\"font-size:11.0pt;font-family:Courier New\">Titre\r\n  en IgG:</span></b><span style=\"font-family:Courier New\"></span></p>\r\n  </td>\r\n  <td style=\"width:445.7pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"594\">\r\n  <h5 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;text-align:center\"><span>IgG&nbsp;&nbsp; =&nbsp;&nbsp; 64</span></h5>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td style=\"width:105.95pt;border:solid windowtext 1.0pt;\r\n  border-top:none;padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"141\">\r\n  <h6 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;\r\n  color:windowtext\">Validation</span><span style=\"\"></span></h6>\r\n  </td>\r\n  <td style=\"width:445.7pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"594\">\r\n  <p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:center\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\