us tard.</span><span style=\"font-family:Courier New;\"></span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify;\r\n     tab-stops:list 36.0pt\"><span style=\"font-family:Courier New;\">Titre\r\n     égal ou supérieur 256 ou immuno peroxydase+++&nbsp;: sérologie fortement\r\n     positive. Cette valeur est le signe d’une infection diffuse à chlamydiae\r\n     (ex&nbsp;: salpingite, pneumopathie, LGV, épididymite, orchite …)</span><span style=\"font-family:Courier New;\"></span></li>\r\n</ul>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify\"><strong><span style=\"font-family:Courier New;\">&nbsp;</span></strong><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify\"><strong><span style=\"font-family:Courier New;\">N.B</span></strong><span style=\"font-family:Courier New;\">&nbsp;:\r\nLes anticorps ainsi décelés peuvent persister longtemps, même après la\r\nguérison.</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n</div>\r\n','igG',2),(1,60,'<div style=\"size:595.3pt 841.9pt;margin:42.55pt 22.3pt 42.55pt 1.0cm;\">\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;text-align:center\" align=\"center\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">SERODIAGNOSTIQUE\r\nDES CHLAMYDIAE</span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\"><span style=\"font-size:11.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">EXAMEN\r\nCLINIQUE</sp