/*Table structure for table `saisie_examen` */

DROP TABLE IF EXISTS `saisie_examen`;

CREATE TABLE `saisie_examen` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `dossier_saisie_id` varchar(255) CHARACTER SET latin1 NOT NULL,
  `ref_examen` int(11) NOT NULL,
  `resultat` int(11) NOT NULL,
  `saisie` tinyint(1) NOT NULL,
  `num_ordre` int(11) DEFAULT NULL,
  `fichier` longtext,
  `description` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `valide` tinyint(1) NOT NULL,
  `date_maj` datetime DEFAULT NULL,
  `user_maj` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `dossier_saisie_id` (`dossier_saisie_id`,`ref_examen`),
  CONSTRAINT `saisie_examen_ibfk_1` FOREIGN KEY (`dossier_saisie_id`) REFERENCES `saisie_dossier` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=342 DEFAULT CHARSET=utf8;

